import React from 'react'

const homeIcon = () => {
  return (
    <svg id="home" width="800px" height="800px" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
    <path d="M22 22L2 22" stroke="#1C274C" stroke-width="1.5" stroke-linecap="round"/>
    </svg>
  )
}

export default homeIcon
